import React from 'react';
import logo from './logo.svg';
import './App.css';
import Card from './Card';
import picture1 from "./Card/images/picture1.jpg";


function App() {
  return (
    <div className="App">
      <Card image={this.props.image}/>
    </div>
  );
}

export default App;
